script: |
  super -f text -I q9912.spq | sort > q9912.out

inputs:
  - name: q9912.spq
    data: |
      SELECT DISTINCT - - 55 * + col1, - col1 * + ( + - 28 ) AS col1 FROM tab0 (FORMAT parquet) WHERE NOT - col0 / - col1 IS NULL;
  - name: tab0

outputs:
  - name: q9912.out
    data: |
      1155	588
      4455	2268
      55	28
